sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var tS = new GlideDateTime();
  var diff = tS.getNumericValue() - parseInt(inputs.startMills);
  outputs.log_line = tS.getDisplayValue() + " | reqID: " + inputs.transactionId + " | ts: " + tS.getNumericValue() + " | from start: " + diff +" mills";
  //return(tS.getDisplayValue() + " | reqID: " + inputs.transactionId + " | ts: " + tS.getNumericValue() + " | from start: " + diff +" mills");
})(inputs, outputs);

